$(function() {

	// Кнопка бургер для раскрытия меню
	$(".header__burger").click(function () {
		$(this).toggleClass('.header__burger active');
		$(".menu__body").slideToggle("slow");
	});


	$('.menu__link').click(function(event) {
		$('.header__burger').toggleClass('.header__burger active');
		$(".menu__body").slideToggle("slow");
	});


	$('#block6__circle').circleProgress({
		value: 0.99,
		size: 120,
		startAngle: Math.PI / -2,
		fill: {
			gradient: ['#f8d219','#fec717']
		}
	}).on('circle-animation-progress', function(event, progress) {
		$(this).find('span:nth-child(2)').html(Math.round(99 * progress));
	});

	var comma_separator_number_step = $.animateNumber.numberStepFactories.separator(' ')
	$('.block6__bignumber-num').animateNumber({ number: 50000, numberStep: comma_separator_number_step });

	var scene = document.getElementById('scene');
	var parallaxInstance = new Parallax(scene);

	// var scene1 = document.getElementById('prlx-1');
	// var parallaxInstance = new Parallax(scene1);

	function ibg(){
		$.each($('.ibg'), function(index, val) {
			if ($(this).find('img').length>0) {
				$(this).css('background-image','url("'+$(this).find('img').attr('src')+'")');
			}
		});
	}
	ibg();

	baguetteBox.run('.block8__wrapper');

	$('.accor__title').click(function(event) {
		$(this).toggleClass('active').next().slideToggle(300);
	});

	$('.menu__link, welcome__offer-img a').mPageScroll2id({});

	$('.block7__slider').slick({
		infinite: true,
		autoplay: true,
		autoplaySpeed: 2500,
		slidesToShow: 3,
		slidesToScroll: 1,
		prevArrow: $(".arr__prev"),
		nextArrow: $(".arr__next"),
		responsive:[{
			breakpoint: 480,
			settings: {
				slidesToShow: 1,
				slidesToScroll: 1,
				arrows: false
			}
		}]
	});

	// Функция включения затемненного фона
	function onOverlay() {
		$('.overlay').fadeIn();
		$('body').css('overflow-y', 'hidden');
	}

	// Функция выключения затемненного фона
	function offOverlay() {
		$('.overlay').fadeOut();
		$('body').css('overflow-y', '');
	}

	// Отправка данных формы
	$('.callback__form').submit(function(event) {
		event.preventDefault();
		var $form = $(this);
		$.ajax({
			url: $form.attr('action'),
			type: $form.attr('method'),
			data: $form.serialize(),
		})
		.done(function() {
			$form[0].reset();
			console.log("Success send data in AmoCRM");
		})
		.fail(function() {
			console.log("Error send data in AmoCRM");
		})
		.always(function() {
			console.log("complete");
		});
	});

	// Назначаем маску для ввода телефона
	// $('#phonenumber').inputmask("9 - (999) 999 9999");

});
